// import taskList
import TaskList from './TaskList'
import TextField from './TextField'
import {rootStore, StoreProvider} from './Datastore';
function App() {
  return (
    <StoreProvider value={rootStore}>
      <div class="main-Todo">
      <h1>Todo List</h1>
      {/* insert all the items in the list */}
      <TaskList/>
      {/* textfield here */}
      <TextField/>
      </div>
    </StoreProvider>
  );
}

export default App;
